import React from "react";
import data from "../db.json";

const Paginas = () => {
  return (
    <div>
      {data.map((pagina) => {
        return (
          <>
            <h1>{pagina.cliente}</h1>
            <video
              width={920}
              height={600}
              controls
              src={pagina.linkVideo}
              type="video/mp4"
            ></video>
            <h2>Transcripci√≥n</h2>
              <textarea cols={50} rows={20}>{pagina.transcripcion}</textarea>
            <h2>Tareas</h2>
              <h2>{pagina.escenario}</h2>

            <h3>{pagina.preguntas.texto}</h3>
          </>
        );
      })}
    </div>
  );
};

export default Paginas;
